import React from "react";
import { AuthContext } from "../../Context/AuthContext";

export const Home = () => {
  const { user, isAuthenticated } = React.useContext(AuthContext);
  return (
    <div>
      {user} <br />
      {isAuthenticated}
    </div>
  );
};
